import React from 'react';
import { Route } from 'react-router-dom';


const Header = () => {
  return(
   <div>
       <h1>Hello</h1>
       <div>
            <Route path='/home'  element={<Navigate to='/' />}/>
       </div>
  </div>
  )
};

export default Header;
